import React from "react";

const CollectionPreview = ({ title, items }) => {
  console.log(title);
  console.log(items);
  return (
    <div className="collection-preview">
      <h1 className="title">{title}</h1>
      <div className="preview">
        {items.map(({ name, imageUrl, price }) => (
          <div>{name}</div>
        ))}
      </div>
    </div>
  );
};

export default CollectionPreview;
